INSERT INTO `movieData` (`id`, `mvTitle`, `mvPoster`, `mvStory`, `mvActor`, `openingDate`, `mvGenre`, `mvVideo`, `mvGrade`, `mvLimit`, `time`) VALUES
('tenet', '테넷', 'http://rudekrudgns.cafe24.com/poster/tenet.jpg', '당신에게 줄 건 한 단어 ‘테넷’ \n “이해하지 말고 느껴라!” \n 시간의 흐름을 뒤집는 인버전을 통해 현재와 미래를 오가며 세상을 파괴하려는 사토르(케네스 브래너)를 막기 위해 투입된 작전의 주도자(존 데이비드 워싱턴). 인버전에 대한 정보를 가진 닐(로버트 패틴슨)과 미술품 감정사이자 사토르에 대한 복수심이 가득한 그의 아내 캣(엘리자베스 데비키)과 협력해 미래의 공격에 맞서 제3차 세계대전을 막아야 한다!', '존 데이비드 워싱턴, 로버트 패틴슨, 엘리자베스 데비키, 애런 존슨, 마이클 케인, 케네스 브래너, 히메쉬 파텔, 클레멘스 포시', '20200826', '액션, SF', '<iframe id=\"mvVideo\"src=\"https://www.youtube.com/embed/IW_khaePCBE\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '8.79', '12세', '150'),
('theswordsman', '검객', 'http://rudekrudgns.cafe24.com/poster/theswordsman.jpg', '광해군 폐위 후, 스스로 자취를 감춘 조선 최고의 검객 ‘태율’(장혁).\n 한편, 조선을 사이에 둔 청과 명의 대립으로 혼란은 극에 달하고,\n 청나라 황족 ‘구루타이’(조 타슬림)는 무리한 요구를 해대며 조선을 핍박한다.\n \n 백성들의 고통이 날로 더해가던 중, ‘구루타이’의 수하들에 의해 태율의 딸이 공녀로 잡혀가고 만다. 세상을 등진 채 조용히 살고자 했던 조선 최고의 검객 ‘태율’은 딸을 구하기 위한 자비 없는 검을 휘두르기 시작하는데...', '장혁, 김현수, 조 타슬림, 정만식, 이나경, 이민혁', '20200923', '액션', '<iframe id=\"mvVideo\" width=\"1280\" height=\"720\" src=\"https://www.youtube.com/embed/murHQPp1ao4\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '8.48', '15세', '100'),
('diva', '디바', 'http://rudekrudgns.cafe24.com/poster/diva.jpg', '두려움의 높이, 10미터 다이빙대의 끝에서\n아름답게 낙하하다\n전 세계가 주목하는 다이빙계의 디바 ‘이영’은\n 어느 날 동료이자 절친 ‘수진’과 함께 교통사고를 당한다.\n \n 사고 후 실종된 ‘수진’을 향한 ‘이영’의 애틋함과 달리\n 동료들은 ‘수진’에 대해 의문스러운 말들을 쏟아내고,\n 혼란스러운 와중에도 ‘이영’은 완벽한 실력을 되찾아야만 한다.\n \n 결국 최고를 지키고자 하는 강렬한 욕망과\n 오랜 시간 친구로 지내왔던 ‘수진’이 자기가 알던 모습이 아닐지도 모른다는 두려움은\n ‘이영’을 점점 광기로 몰아넣는데…\n \n 다이빙계의 디바\n 알 수 없는 깊이의 두려움 속으로 빠져들다', '신민아, 이유영, 이규형', '20200923', '스릴러, 미스터리', '<iframe id=\"mvVideo\" width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/I5te-yJTkhU\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '7.07', '15세', '84'),
('mulan', '뮬란', 'http://rudekrudgns.cafe24.com/poster/mulan.jpg', '무예에 남다른 재능을 지닌 ‘뮬란’은\n 좋은 집안과 인연을 맺어 가문을 빛내길 바라는\n 부모님의 뜻에 따라 본연의 모습을 억누르고 성장한다.\n \n 어느 날, 북쪽 오랑캐들이 침입하자 황제는 징집령을 내리고\n ‘뮬란’은 아픈 아버지를 대신해 가족들 몰래 전장에 나가기로 결심한다.\n \n 여자라는 게 발각되면 목숨을 잃을 수도 있는 상황 속에서\n ‘뮬란’은 타고난 용기와 지혜로 역경을 이겨내며 전사로 성장한다.\n \n 마침내 잔인무도한 적장 ‘보리 칸’과 마녀 ‘시아니앙’을 마주하게 된 ‘뮬란’.\n 그녀는 위험에 빠진 동료와 가족을 구하고 진정한 전사로 거듭날 수 있을 것인가', '유역비', '20200917', '모험, 드라마, 가족', '<iframe id=\"mvVideo\" width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/T9ro7JpeoVU\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '4.48', '12세', '115'),
('theoutpost', '아웃포스트', 'http://rudekrudgns.cafe24.com/poster/theoutpost.jpg', '반드시 살아남아 임무를 완수하라!\n사방이 산으로 둘러싸인 방어 불가 지상 최악의 전초기지!\n 적의 공격에 무방비하게 노출될 수밖에 없는 이곳\n 아군의 지원은 물론 제대로 된 보급조차 기대하기 힘들다.\n 군 조사단조차 ‘명백히 방어 불가능’ 이라는 판정을 내린 상태.\n 호시탐탐 기회를 엿보는 적들로, 매일매일이 위험한 상황 속 총공세가 시작 되는데…', '올랜도 블룸, 스콧 이스트우드, 케일럽 랜드리 존스', '20200923', '전쟁, 드라마', '<iframe id=\"mvVideo\" width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/TSWJB_Fbdgg\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '9.12', '15세', '123'),
('BeautyWater', '기기괴괴 성형수', 'http://rudekrudgns.cafe24.com/poster/BeautyWater.jpg', '“새로운 삶을 원하나요?”\n지금부터 기적의 성형수 사용 방법을 알려드리겠습니다.\n 본인의 얼굴을 거울로 확인해 보세요.\n 사진을 찍어두셔도 좋습니다. 마지막 작별의 시간이니까요.\n 물과 성형수를 4:1 비율로 섞은 후, 20분간 얼굴을 담가주세요.\n 앞으로 당신의 근육과 살의 성질이 완전히 변하게 됩니다. 찰흙처럼 말이죠.\n 겁먹지 말고… 당신이 원하는 얼굴을 만들어보세요\n 이제 당신은 새로 태어나는 겁니다. 아주 새롭게…\n \n 부작용, 후유증 없이 아름다워지는 단 하나의 방법\n 바르면 성형이 되는 기적의 물 성형수\n 올여름 가장 기괴하고 독창적인 호러성형괴담이 온다!', '문남숙, 장민혁, 조현정, 김보영, 최승훈', '20200909', '공포, 스릴러', '<iframe id=\"mvVideo\" width=\"904\" height=\"509\" src=\"https://www.youtube.com/embed/DNb9QP5kilE\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '6.95', '15세', '85'),
('OhMyGran', '오! 문희', 'http://rudekrudgns.cafe24.com/poster/OhMyGran.jpg', '평화로운 금산 마을.\n 불같은 성격에 가족 사랑도 뜨거운 ‘두원’(이희준)에게\n 하나뿐인 딸 ‘보미’가 뺑소니 사고를 당했다는 청천벽력 같은 소식이 전해진다.\n 게다가 현장의 유일한 목격자는\n 기억이 깜빡깜빡하는 엄니 ‘문희’(나문희)와 왈왈 짖기만 하는 개 ‘앵자’뿐.\n \n 의식 불명 상태로 병원에 있는 ‘보미’.\n 경찰 수사에 진전이 없자 ‘두원’의 속은 점점 타들어간다.\n 하지만 예기치 못한 순간 엄니 ‘문희’가 뜻밖의 단서를 기억해내고\n ‘두원’은 엄니와 함께 논두렁을 가르며 직접 뺑소니범을 찾아 나서기 시작하는데!\n \n 아무도 못 잡으면, 우리가 직접 잡는다!', '나문희, 이희준, 최원영, 박지영, 이진주', '20200902', '코미디, 드라마', '<iframe id=\"mvVideo\" width=\"904\" height=\"509\" src=\"https://www.youtube.com/embed/-kBDeuAf7nc\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '8.04', '12세', '109'),
('FrancesHa', '프란시스 하', 'http://rudekrudgns.cafe24.com/poster/FrancesHa.jpg', '브루클린의 작은 아파트에서 둘도 없는 친구 소피와 살고 있는 27살 뉴요커 프란시스.\n 무용수로 성공해 뉴욕을 접수하겠다는 거창한 꿈을 꾸지만 현실은 몇 년째 평범한 연습생 신세일 뿐이다.\n 사소한 말다툼 끝에 애인과 헤어지고 믿었던 소피마저 독립을 선언하자 그녀의 일상은 꼬이기 시작한다.\n 직업도, 사랑도, 우정도 무엇 하나 쉽지 않은 그녀는 과연 당당하게 홀로서기에 성공할 수 있을까?\n \n 가장 보통의 뉴욕에서 만나는 우리 모두의 이야기가 시작된다!', '그레타 거윅, 믹키 섬너, 아담 드라이버, 그레이스 검머, 마이클 제겐', '20200924', '코미디, 멜로, 로맨스', '<iframe id=\"mvVideo\" width=\"904\" height=\"509\" src=\"https://www.youtube.com/embed/2Mj1mNRpPPY\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '8.13', '15세', '86'),
('TheWomanWhoRan', '도망친 여자 ', 'http://rudekrudgns.cafe24.com/poster/The Woman Who Ran.jpg', '남편이 출장을 간 사이 ‘감희’는 세 명의 친구를 만난다. 두 명은 그녀가 그들의 집들을 방문한 것이고, 세 번째 친구는 극장에서 우연히 만났다. 우정의 대화가 이어지는 동안, 언제나처럼, 바다 수면 위와 아래로 여러 물결들이 독립적으로 진행되고 있다.', '김민희, 서영화, 송선미, 김새벽, 권해효', '20200917', '드라마', '<iframe id=\"mvVideo\" width=\"682\" height=\"384\" src=\"https://www.youtube.com/embed/D2yiy0JKqXY\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '7.52', '19세', '77'),
('DELIVERUSFROMEVIL', '다만 악에서 구하소서', 'http://rudekrudgns.cafe24.com/poster/DELIVER US FROM EVIL.jpg', '태국에서 충격적인 납치사건이 발생하고\n 마지막 청부살인 미션을 끝낸 암살자 인남(황정민)은 그것이 자신과 관계된 것임을 알게 된다.\n 인남은 곧바로 태국으로 향하고, 조력자 유이(박정민)를 만나 사건을 쫓기 시작한다.\n 한편, 자신의 형제가 인남에게 암살당한 것을 알게 된 레이(이정재).\n 무자비한 복수를 계획한 레이는 인남을 추격하기 위해 태국으로 향하는데...\n \n 처절한 암살자 VS 무자비한 추격자\n 멈출 수 없는 두 남자의 지독한 추격이 시작된다!', '황정민, 이정재, 박정민, 박소이, 최희서', '20200805', '범죄, 액션', '<iframe id=\"mvVideo\" width=\"682\" height=\"384\" src=\"https://www.youtube.com/embed/4wgN4Q6Gkj8\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '7.66', '15세', '108'),
('DaCapo', '다시 만난 날들', 'http://rudekrudgns.cafe24.com/poster/Da Capo.jpg', '무명의 싱어송라이터로 현실과 타협하며 살다 자괴감에 빠진 태일은\n 원하던 음악을 하던 밴드시절을 그리워하다 무작정 추억을 쫓아 고향으로 떠난다.\n 그 곳에서 태일은 밴드 멤버였던 지원과 필만 충만한 중2병 밴드 ‘디스토리어’를 만나게 된다.\n 좋아하는 사람과 음악 속에서 영감을 얻은 태일, 지원의 도움을 받아 미완의 트랙을 완성하게 되는데!\n \n ‘이루지 못한 사랑, 포기했던 꿈, 깨어진 관계, 전하지 못한 마음’\n 서툴렀던 청춘의 습작, 우리가 다시 완성할 수 있을까?\n \n 다른 시간, 다른 공간, 같은 노래로 우리는 하나가 된다.', '홍이삭, 장하은, 서영재, 장다현, 양태환', '20200924', '드라마', '<iframe id=\"mvVideo\" width=\"682\" height=\"384\" src=\"https://www.youtube.com/embed/0ImV-4iIUpc\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '9.55', '12세', '100'),
('MyExtraordinarySummerwithTess', '테스와 보낸 여름', 'http://rudekrudgns.cafe24.com/poster/MyExtraordinarySummerwithTess.jpg', '세상 진지한 4차원 소년 ‘샘’ X 저세상 텐션 5차원 소녀 ‘테스’\n엉뚱한 소년 ‘샘’은 가족과 함께 떠난 바닷가 휴양지에서도 죽음에 대해 고민하는 중이다.\n 지구에 남은 마지막 공룡은 어떤 마음이었을까 상상하던 ‘샘’은\n  언젠가 혼자 남겨질 경우를 대비해 ‘외로움 적응 훈련’에 돌입한다.\n 그런데 섬에서 만난 소녀 ‘테스’로 인해 계획에 차질이 생기기 시작한다.\n 첫 만남에 다짜고짜 살사 춤을 추자고 하는 더 엉뚱한 소녀 ‘테스’는\n  어디로 튈지 알 수 없는 행동으로 ‘샘’을 놀라게 한다.\n 그러던 중 어른들은 모르는 ‘테스’의 비밀스러운 계획을 알게 된 ‘샘’은 이에 동참하게 되는데…\n 얼마 남지 않은 여름의 끝, 그전에 미션을 수행해야 한다!\n \n 혼자도 좋지만… 함께여서 더욱 좋은!\n ‘샘’과 ‘테스’의 인생을 건 여름 프로젝트가 시작된다!', '소니 코프스 판 우테렌, 조세핀 아렌센, 트에보 게리츠마', '20200910', '드라마', '<iframe id=\"mvVideo\" width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/KzcYMeeWszU\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '9.23', '전체', '84'),
('GreenBook', '그린 북', 'http://rudekrudgns.cafe24.com/poster/GreenBook.jpg', '언제 어디서든 바른 생활! 완벽한 천재 뮤지션 ‘돈 셜리’\n원칙보다 반칙! 다혈질 운전사 ‘토니’\n취향도, 성격도 완벽히 다른 두 남자의 특별한 우정이 시작된다!\n1962년 미국, 입담과 주먹만 믿고 살아가던 토니 발레롱가(비고 모텐슨)는 교양과 우아함 그 자체인\n 천재 피아니스트 돈 셜리(마허샬라 알리) 박사의 운전기사 면접을 보게 된다.\n \n 백악관에도 초청되는 등 미국 전역에서 콘서트 요청을 받으며 명성을 떨치고 있는 돈 셜리는\n 위험하기로 소문난 미국 남부 투어 공연을 떠나기로 결심하고,\n 투어 기간 동안 자신의 보디가드 겸 운전기사로 토니를 고용한다.\n \n 거친 인생을 살아온 토니 발레롱가와 교양과 기품을 지키며 살아온 돈 셜리 박사.\n 생각, 행동, 말투, 취향까지 달라도 너무 다른 두 사람은\n 그들을 위한 여행안내서 ‘그린북’에 의존해 특별한 남부 투어를 시작하는데…', '비고 모텐슨, 마허샬라 알리', '20190109', '드라마', '<iframe id=\"mvVideo\" width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/hK_DHPxE2Xg\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '9.59', '12세', '130'),
('Capernaum', '가버나움', 'http://rudekrudgns.cafe24.com/poster/Capernaum.jpg', '나를 세상에 태어나게 한\n \"부모님을 고소하고 싶어요...\"\n -출생기록조차 없이 살아온 어쩌면 12살 소년 \"자인\"으로부터', '자인 알 라피아, 요르다노스 시프로우', '20190124 ', '드라마', '<iframe id=\"mvVideo\" width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/6m3AoljRIJU\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '9.59', '15세', '126'),
('UsandThem', '먼 훗날 우리 ', 'http://rudekrudgns.cafe24.com/poster/UsandThem.jpg', '2007년 춘절, 귀향하는 기차에서 처음 만나 친구가 된 ‘린젠칭’(정백연)과 ‘팡샤오샤오’(주동우). 베이징에서 함께 꿈을 나누며 연인으로 발전하지만, 현실의 장벽 앞에 결국 가슴 아픈 이별을 하게 된다. 10년이 흐른 후, 두 사람은 북경행 비행기에서 운명처럼 재회하고 지난 시간들을 돌아보며 추억을 이야기하기 시작하는데…', '정백연, 주동우, 톈좡좡', '2018', '드라마, 멜로, 로맨스', '<iframe id=\"mvVideo\" width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/XaY-18brpFs\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '9.58', '12세', '120'),
('FORDvFERRARI', '포드 V 페라리', 'http://rudekrudgns.cafe24.com/poster/FORDvFERRARI.jpg', '자존심을 건 대결의 시작!\n1960년대, 매출 감소에 빠진 ‘포드’는 판매 활로를 찾기 위해\n 스포츠카 레이스를 장악한 절대적 1위 ‘페라리’와의 인수 합병을 추진한다.\n 막대한 자금력에도 불구, 계약에 실패하고 엔초 페라리로부터 모욕까지 당한 헨리 포드 2세는\n 르망 24시간 레이스에서 페라리를 박살 낼 차를 만들 것을 지시한다.\n \n 불가능을 즐기는 두 남자를 주목하라!\n \n 세계 3대 자동차 레이싱 대회이자 ‘지옥의 레이스’로 불리는 르망 24시간 레이스.\n 출전 경험조차 없는 ‘포드’는 대회 6연패를 차지한 ‘페라리’에 대항하기 위해\n 르망 레이스 우승자 출신 자동차 디자이너 ‘캐롤 셸비’(맷 데이먼)를 고용하고,\n 그는 누구와도 타협하지 않지만 열정과 실력만큼은 최고인\n 레이서 ‘켄 마일스’(크리스찬 베일)를 자신의 파트너로 영입한다.\n \n 포드의 경영진은 제 멋대로인 ‘켄 마일스’를 눈엣가시처럼 여기며\n 자신들의 입맛에 맞춘 레이스를 펼치기를 강요하지만\n 두 사람은 어떤 간섭에도 굴하지 않고 불가능을 뛰어넘기 위한 질주를 시작하는데…\n \n 그 어떤 각본보다 놀라운 실화가 펼쳐진다!', '맷 데이먼, 크리스찬 베일', '20191204', '액션, 드라마', '<iframe id=\"mvVideo\" width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/sn7wcMigCCo\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '9.49', '12세', '152'),
('TheShawshankRedemption', '쇼생크 탈출', 'http://rudekrudgns.cafe24.com/poster/TheShawshankRedemption.jpg', '두려움은 너를 죄수로 가두고 희망은 너를 자유롭게 하리라\n촉망 받던 은행 부지점장 ‘앤디(팀 로빈슨 分)’는 아내와 그 애인을 살해한 혐의로 종신형을 받고 쇼생크 교도소에 수감된다.\n 강력범들이 수감된 이곳에서 재소자들은 짐승 취급 당하고, 혹여 간수 눈에 잘못 보였다가는 개죽음 당하기 십상이다.\n 처음엔 적응 못하던 ‘앤디’는 교도소 내 모든 물건을 구해주는 ‘레드(모건 프리먼 分)’와 친해지며 교도소 생활에 적응하려 하지만, 악질 재소자에게 걸려 강간까지 당한다.\n 그러던 어느 날, 간수장의 세금 면제를 도와주며 간수들의 비공식 회계사로 일하게 되고, 마침내는 소장의 검은 돈까지 관리해주게 된다.\n 덕분에 교도소 내 도서관을 열 수 있게 되었을 무렵, 신참내기 ‘토미(길 벨로우스 分)’로부터 ‘앤디’의 무죄를 입증할 기회를 얻지만, 노튼 소장은 ‘앤디’를 독방에 가두고 ‘토미’를 무참히 죽여버리는데...', '팀 로빈스, 모건 프리먼', '19950128', '드라마', '<iframe id=\"mvVideo\" width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/p8tgEikbrvc\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '9.44', '15세', '142'),
('BohemianRhapsody', '보헤미안 랩소디', 'http://rudekrudgns.cafe24.com/poster/BohemianRhapsody.jpg', '“나는 스타가 되지 않을 것이다, 전설이 될 것이다”\n공항에서 수하물 노동자로 일하며 음악의 꿈을 키우던 이민자 출신의 아웃사이더 ‘파록버사라’\n 보컬을 구하던 로컬 밴드에 들어가게 되면서 ‘프레디 머큐리’라는 이름으로 밴드 ‘퀸’을 이끌게 된다.\n \n 시대를 앞서가는 독창적인 음악과 화려한 퍼포먼스로 관중들을 사로잡으며 성장하던 ‘퀸’은\n 라디오와 방송에서 외면을 받을 것이라는 음반사의 반대에도 불구하고\n 무려 6분 동안 이어지는 실험적인 곡 ‘보헤미안 랩소디’로 대성공을 거두며 월드스타 반열에 오른다.\n \n 그러나 독보적인 존재감을 뿜어내던 ‘프레디 머큐리’는 솔로 데뷔라는 유혹에 흔들리게 되고\n 결국 오랜 시간 함께 해왔던 멤버들과 결별을 선언하게 되는데…\n \n 세상에서 소외된 아웃사이더에서 전설의 록밴드 ‘퀸’이 되기까지,\n 우리가 몰랐던 그들의 진짜 이야기가 시작된다!', '라미 말렉, 루시 보인턴, 귈림 리', '20181031', '드라마', '<iframe id=\"mvVideo\" width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/XTZko22Ze3o\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '9.42', '12세', '134'),
('SavingPrivateRyan', '라이언 일병 구하기', 'http://rudekrudgns.cafe24.com/poster/SavingPrivateRyan.jpg', '임무는 단 한 사람(The Mission is a Man)\n1944년 6월 6일 노르망디 상륙 작전. 오마하 해변에 대기하고 있던 병사들은 한치 앞도 내다볼 수 없는 긴장된 상황과 두려움에 무기력함을 감출 수 없었다. 노르망디 해변을 응시하는 밀러 대위(Captain Miller: 톰 행크스 분) 그리고 전쟁 중 가장 어려운 임무를 수행해야할 두려움에 지친 그의 대원들. 지옥을 방불케하는 치열한 총격전이 벌어지고 수 많은 병사들이 총 한번 제대로 쏘지 못하고 쓰러져간다. 마침내 밀러 대위를 위시한 그들은 몇번의 죽을 고비를 넘기고 맡은 바 임무를 완수한다.\n  같은 시각, 2차 대전이 종전으로 치닫는 치열한 전황 속에서 미 행정부는 전사자 통보 업무를 진행하던 중 충격적인 사실을 발견하게 된다. 4형제 모두 이 전쟁에 참전한 라이언 가에서 며칠간의 시차를 두고 3형제가 이미 전사하고 막내 제임스 라이언 일병(Private Ryan: 맷 데몬 분)만이 프랑스 전선에 생존해 있음을 알게 된 것이다. 네명의 아들 가운데 이미 셋을 잃은 라이언 부인을 위해 미 행정부는 막내 제임스를 구하기 위한 매우 특별한 작전을 지시한다. 결국 사령부에서 막내를 찾아 집으로 보낼 임무는 밀러에게 부여되고, 이것은 이제껏 수행했던 임무보다 훨씬 어렵고 힘든 것이었다.\n  밀러는 여섯 명의 대원들과 통역병 업햄(Corporal Timothy Upham: 제레미 데이비스 분) 등 새로운 팀을 구성, 작전에 투입된다. 라이언의 행방을 찾아 최전선에 투입된 밀러와 대원들은 미군에게 접수된 마을을 지나던 중 의외로 쉽게 그를 찾아낸다. 하지만 임무 완수의 기쁨도 잠시. 그는 제임스 라이언과 성만 같은 다른 인물로 밝혀진다. 다음 날, 밀러 일행은 우연히 한 부상병을 통해 제임스 라이언이 라멜 지역의 다리를 사수하기 위해 작전에 투입됐고, 현재는 독일군 사이에 고립돼 있다는 사실을 듣게 된다.\n  단 한명의 목숨을 구하기 위해 여덟 명이 위험을 감수해야할 상황에서 대원들은 과연 ‘라이언 일병 한 명의 생명이 그들 여덟 명의 생명보다 더 가치가 있는 것인가?’라는 끊임없는 혼란에 빠진다. 하지만 지휘관으로서 작전을 끝까지 책임지고 성공적으로 완수해야 할 밀러는 부하들을 설득해 다시 라이언 일병이 있다는 곳으로 향한다. 도중에 독일군과의 간헐적인 전투를 치르면서 결국 밀러 일행은 라멜 외곽지역에서 극적으로 라이언 일병을 찾아낸다. 하지만 라이언은 다리를 사수해야할 동료들을 사지에 남겨두고 혼자 돌아가는 것을 거부하는데.', '톰 행크스, 에드워드 번즈, 톰 시즈모어', '19980912', '전쟁, 액션, 드라마', '<iframe id=\"mvVideo\" width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/clcfRC_Oxxs\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '9.41', '15세', '170'),
('DongJu', '동주', 'http://rudekrudgns.cafe24.com/poster/DongJu.jpg', '이름도, 언어도, 꿈도, 모든 것이 허락되지 않았던 일제강점기.\n 한 집에서 태어나고 자란 동갑내기 사촌지간 동주와 몽규.\n 시인을 꿈꾸는 청년 동주에게 신념을 위해 거침없이 행동하는 청년 몽규는\n 가장 가까운 벗이면서도, 넘기 힘든 산처럼 느껴진다.\n 창씨개명을 강요하는 혼란스러운 나라를 떠나 일본 유학 길에 오른 두 사람.\n 일본으로 건너간 뒤 몽규는 더욱 독립 운동에 매진하게 되고,\n 절망적인 순간에도 시를 쓰며 시대의 비극을 아파하던 동주와의 갈등은 점점 깊어진다.\n 어둠의 시대, 평생을 함께 한 친구이자 영원한 라이벌이었던\n 윤동주와 송몽규의 끝나지 않은 이야기가 지금 시작된다.', '강하늘, 박정민, 김인우', '20160217', '드라마', '<iframe id=\"mvVideo\" width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/1JHhqldrUYg\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '9.37', '12세', '110'),
('Twenty', '스물', 'http://rudekrudgns.cafe24.com/poster/Twenty.jpg', '인기만 많은 놈 ‘치호’\n 생활력만 강한 놈 ‘동우’\n 공부만 잘하는 놈 ‘경재’\n \n 아무것도 하지 않는 잉여의 삶을 지향하는 인기절정의 백수,\n 만화가가 되겠다는 꿈을 위해 쉴 틈 없이 준비하는 생활력 강한 재수생,\n 대기업 입사가 목표인 최강 스펙의 엄친아이지만 술만 마시면 돌변하는 새내기 대학생까지\n 인생의 가장 부끄러운 순간을 함께 한 스무살 동갑내기 세 친구의 자체발광 코미디!', '김우빈, 준호, 강하늘', '20150325', '코미디, 드라마', '<iframe id=\"mvVideo\" width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/jH6-ZBUbg-M\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '8.60', '15세', '115'),
('TimetoHunt', '사냥의 시간 ', 'http://rudekrudgns.cafe24.com/poster/TimetoHunt.jpg', '그날, 우리는 놈의 사냥감이 되었다\n희망 없는 도시, 감옥에서 출소한 ‘준석’(이제훈)은 가족 같은 친구들 ‘장호’(안재홍)와 ‘기훈’(최우식)\n 그리고 ‘상수’(박정민)와 함께 새로운 인생을 위한 위험한 작전을 계획한다.\n 하지만 미래를 향한 부푼 기대도 잠시, 정체불명의 추격자가 나타나 목숨을 노리며 이들을 뒤쫓기 시작한다.\n 서로가 세상의 전부인 네 친구들은 놈의 사냥에서 벗어날 수 있을까?\n \n 심장을 조여오는 지옥 같은 사냥의 시간이 시작된다', '이제훈, 안재홍, 최우식, 박정민, 박해수', '20200423', '스릴러', '<iframe id=\"mvVideo\" width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/SY7z1_eJmY0\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '5.63', '15세', '134'),
('PARASITE', '기생충', 'http://rudekrudgns.cafe24.com/poster/PARASITE.jpg', '“폐 끼치고 싶진 않았어요”\n전원백수로 살 길 막막하지만 사이는 좋은 기택(송강호) 가족.\n 장남 기우(최우식)에게 명문대생 친구가 연결시켜 준 고액 과외 자리는\n 모처럼 싹튼 고정수입의 희망이다.\n 온 가족의 도움과 기대 속에 박사장(이선균) 집으로 향하는 기우.\n 글로벌 IT기업 CEO인 박사장의 저택에 도착하자\n 젊고 아름다운 사모님 연교(조여정)가 기우를 맞이한다.\n \n 그러나 이렇게 시작된 두 가족의 만남 뒤로, 걷잡을 수 없는 사건이 기다리고 있었으니…', '송강호, 이선균, 조여정, 최우식, 박소담, 이정은, 장혜진', '20190530', '드라마', '<iframe id=\"mvVideo\" width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/jBdRhhSt3Bc\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '8.49', '15세', '131'),
('ATaxiDriver', '택시운전사', 'http://rudekrudgns.cafe24.com/poster/ATaxiDriver.jpg', '1980년 5월, 서울 택시운전사.\n“광주? 돈 워리, 돈 워리! 아이 베스트 드라이버”\n택시운전사 만섭(송강호)은 외국손님을 태우고 광주에 갔다 통금 전에 돌아오면\n 밀린 월세를 갚을 수 있는 거금 10만원을 준다는 말에\n 독일기자 피터(토마스 크레취만)를 태우고 영문도 모른 채 길을 나선다.\n \n 광주 그리고 사람들. “모르겄어라, 우덜도 우덜한테 와 그라는지…”\n 어떻게든 택시비를 받아야 하는 만섭의 기지로 검문을 뚫고 겨우 들어선 광주.\n 위험하니 서울로 돌아가자는 만섭의 만류에도\n 피터는 대학생 재식(류준열)과 황기사(유해진)의 도움 속에 촬영을 시작한다.\n 그러나 상황은 점점 심각해지고 만섭은 집에 혼자 있을 딸 걱정에 점점 초조해지는데…', '송강호, 토마스 크레취만, 유해진', '20170802', '드라마, 가족', '<iframe id=\"mvVideo\" width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/0dd_NTbUV9g\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '9.03', '15세', '137'),
('TheAgeofShadows', '밀정', 'http://rudekrudgns.cafe24.com/poster/TheAgeofShadows.jpg', '1920년대 일제강점기.\n 조선인 출신 일본경찰 이정출(송강호)은 무장독립운동 단체 의열단의 뒤를 캐라는 특명으로\n 의열단의 리더 김우진(공유)에게 접근하고, 한 시대의 양 극단에 서 있는 두 사람은\n 서로의 정체와 의도를 알면서도 속내를 감춘 채 가까워진다.\n 출처를 알 수 없는 정보가 쌍방간에 새어나가고 누가 밀정인지 알 수 없는 가운데,\n 의열단은 일제의 주요 시설을 파괴할 폭탄을 경성으로 들여오기 위해,\n 그리고 일본 경찰은 그들을 쫓아 모두 상해에 모인다.\n \n 잡아야만 하는 자들과 잡힐 수 없는 자들 사이,\n 자신의 목표를 위해 서로를 이용하려는 암투와 회유,\n 교란 작전이 숨가쁘게 펼쳐지는 긴장감 속에서\n 폭탄을 실은 열차는 국경을 넘어 경성으로 향하는데…', '송강호, 공유', '20160907', '액션', '<iframe id=\"mvVideo\" width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/6qpxtgxCFzQ\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '8.44', '15세', '140'),
('STARTUP', '시동', 'http://rudekrudgns.cafe24.com/poster/STARTUP.jpg', '학교도 싫고 집도 싫고 공부는 더더욱 싫다며\n \"엄마\"(염정아)에게 1일 1강스파이크를 버는 반항아 \"택일\"(박정민).\n 절친 \"상필\"(정해인)이 빨리 돈을 벌고 싶다며 사회로 뛰어들 때,\n 무작정 집을 뛰쳐나간 \"택일\"은\n 우연히 찾은 장품반점에서 남다른 포스의 주방장 \"거석이형\"(마동석)을 만나게 된다.\n 강렬한 첫 인사를 나누자마자 인생 최대 적수가 된 \"거석이형\"과 \"택일\".\n 세상 무서울 것 없던 \"택일\"은 장품반점에서 상상도 못한 이들을 만나\n 진짜 세상을 맛보게 되는데?\n \n 인생 뭐 있어?\n 일단 한번 살아보는 거야!', '마동석, 박정민, 정해인, 염정아, 최성은', '20191218', '드라마', '<iframe id=\"mvVideo\" width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/hKlpat_0IF0\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '7.55', '15', '102'),
('ADogsPurpose', '베일리 어게인', 'http://rudekrudgns.cafe24.com/poster/ADogsPurpose.jpg', '이번 생은 처음인 우리에게 견생 4회차, 베일리의 빅허그♥ 귀여운 소년 ‘이든’의 단짝 반려견 ‘베일리’는 행복한 생을 마감한다. 하지만 눈을 떠보니 다시 시작된 견생 2회차, 아니 3회차?! 1등 경찰견 ‘엘리’에서 찰떡같이 마음을 알아주는 소울메이트 ‘티노’까지! 다시 태어날 때마다 성별과 생김새, 직업(?)에 이름도 바뀌지만, 여전히 영혼만은 사랑 충만! 애교 충만! 주인바라기 ‘베일리’ 어느덧 견생 4회차, 방랑견이 되어 떠돌던 ‘베일리’는 마침내 자신이 돌아온 진짜 이유를 깨닫고 어딘가로 달려가기 시작하는데…', '조시 게드, 데니스 퀘이드, K.J. 아파', '20181122', '모험, 코미디, 드라마', '<iframe id=\"mvVideo\" width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/i5dCPEJibgk\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', '9.53', '전체', '100');
